import React from 'react';
import { Navbar } from '../ui/Navbar';
import BigCalendar from 'react-big-calendar';
import moment from 'moment';


const localizer = BigCalendar.momentLocalizer(moment);

const events = [{
    title: 'Cumpleloco',
    start: moment().toDate(),
    end: moment().toDate()
}]

export const CalendarPage = () => {
    return (
        <div>

            <Navbar />


            <BigCalendar
                localizer={localizer}
                events={myEventsList}
                startAccessor="start"
                endAccessor="end"
            />

        </div>
    )
}
